import React from 'react';

const PersonForm = ({
  handleOnSubmit,
  newName,
  handleOnNameChange,
  newNumber,
  handleOnNumberChange,
}) => {
  return (
    <form onSubmit={handleOnSubmit}>
      <div>
        name:
        <input 
          value={newName}
          onChange={handleOnNameChange}
        />
      </div>
      <div>
        number:
        <input
          value={newNumber}
          onChange={handleOnNumberChange}
        />
      </div>
      <div>
        <button type='submit'>add</button>
      </div>
    </form>
  );
};

export default PersonForm;
